import React from "react";
import back_img from "../media/back_img.jpg";
import raccoon from "../media/raccoon.jpg";
import "./Profile.css";

const Profile = () => {
    return (
        <div className="content">
            <div>
                <img src={back_img}/>
            </div>
            <div>
                <img src={raccoon}/>
            </div>
            <div>
                My posts
                <div>New post</div>
                <div className="posts">
                    <div className="item">
                        post 1
                    </div>
                    <div className="item">
                        post 2
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Profile;
